  componentDidMount() {
    axios.get(`http://127.0.0.1:9393/test`)
    .then(res => {
      console.log(res.data);
    })
    alert( message );
  }
  user(name) {

    axios.get(`http://127.0.0.1:9393/userStats?name=${ name }`)
    .then(res => {
      console.log(res.data);
    })
  } 

  render() {
    return (
      <div>
        <Board />
      </div>
    )
  }
}

export default App;
